  display: flex;
  /* align-items: center; */
  padding: 40px;

  .image {
    position: relative;
    padding: 3px;
    border: 1px solid #ccc;

    img {
      width: 150px;
      height: 150px;
    }
  }

  .mask {
    width: 150px;
    height: 150px;
    background-position: -230px -380px;
    position: absolute;
    top: 0;
    margin-top: 3px;
  }

  .info {
    padding-left: 30px;
    padding-top: 24px;

    .name {
      line-height: 24px;
      font-size: 20px;
      font-weight: normal;
    }

